    @Override
    public final void onScrewdriverRightClick(ForgeDirection side, EntityPlayer aPlayer, float aX, float aY, float aZ) {
        if (getBaseMetaTileEntity().isServerSide()) {
            this.mode = (byte) ((this.mode + 1) % 4);
            GT_Utility
                .sendChatToPlayer(aPlayer, StatCollector.translateToLocal("IndistinctTentacle.modeMsg." + this.mode));
        }
    }

    @Override
    protected ProcessingLogic createProcessingLogic() {
        return new GTCM_ProcessingLogic() {

            @NotNull
            @Override
            protected CheckRecipeResult validateRecipe(@Nonnull GT_Recipe recipe) {
                // component assembly line
                if (mode == 1 && recipe.mSpecialValue > tierComponentCasing + 1) {
                    return CheckRecipeResultRegistry.insufficientMachineTier(recipe.mSpecialValue);
                }
                // check component block tier
                byte recipeTier = GT_Utility.getTier(recipe.mEUt);
                if (recipeTier > tierComponentCasing + 2) {
                    return CheckRecipeResultRegistry.insufficientMachineTier(recipeTier);
                }
                // if component block tier higher than recipe voltage tier,
                // use perfect overclock
                setOverclock(recipeTier <= tierComponentCasing ? 2 : 1, 2);
                return CheckRecipeResultRegistry.SUCCESSFUL;
            }

            @NotNull
            @Override
            public CheckRecipeResult process() {

                setEuModifier(getEuModifier());
                setSpeedBonus(getSpeedBonus());
                return super.process();
            }

            @Nonnull
            @Override
            protected GT_OverclockCalculator createOverclockCalculator(@Nonnull GT_Recipe recipe) {
                if (isWirelessMode) {
                    return GT_OverclockCalculator.ofNoOverclock(recipe);
                } else {
                    return super.createOverclockCalculator(recipe);
                }
            }

        }.setMaxParallelSupplier(this::getLimitedMaxParallel);
    }

    @Override
    protected void setProcessingLogicPower(ProcessingLogic logic) {
        if (isWirelessMode) {
            // wireless mode ignore voltage limit
            logic.setAvailableVoltage(Long.MAX_VALUE);
            logic.setAvailableAmperage(1);
            logic.setAmperageOC(false);
        } else {
            super.setProcessingLogicPower(logic);
        }
    }

    @NotNull
    @Override
    public CheckRecipeResult checkProcessing() {
        setupProcessingLogic(processingLogic);

        CheckRecipeResult result = doCheckRecipe();
        result = postCheckRecipe(result, processingLogic);
        // inputs are consumed at this point
        updateSlots();
        if (!result.wasSuccessful()) return result;

        mEfficiency = 10000;
        mEfficiencyIncrease = 10000;
        if (isWirelessMode) {
            if (Utils.metaItemEqual(getControllerSlot(), astralArrayFabricator.get(1))) {
                mMaxProgresstime = ValueEnum.AstralArrayOverclockedTickEveryProcess_WirelessMode_IndistinctTentacle;
                extraEuCostMultiplier = ExtraEuCostMultiplierAstralArrayOverclocked_WirelessMode_IndistinctTentacle;
            } else {
                mMaxProgresstime = ValueEnum.TickEveryProcess_WirelessMode_IndistinctTentacle;
                extraEuCostMultiplier = 1;
            }

            long originEUCost = processingLogic.getCalculatedEut() * processingLogic.getDuration();
            if (processingLogic.getCalculatedEut() > Long.MAX_VALUE / processingLogic.getDuration()) {
                // total eu cost has overflowed
                costingWirelessEUTemp = 1145141919810L;
                BigInteger finalCostEU = BigInteger.valueOf(-1)
                    .multiply(BigInteger.valueOf(processingLogic.getCalculatedEut()))
                    .multiply(BigInteger.valueOf(processingLogic.getDuration()))
                    .multiply(BigInteger.valueOf(extraEuCostMultiplier));
                if (!addEUToGlobalEnergyMap(ownerUUID, finalCostEU)) {
                    return CheckRecipeResultRegistry.insufficientPower(1145141919810L);
                }
            } else if (originEUCost < Long.MAX_VALUE / extraEuCostMultiplier) {
                // not overflow
                costingWirelessEUTemp = originEUCost * extraEuCostMultiplier;
                if (!addEUToGlobalEnergyMap(ownerUUID, -costingWirelessEUTemp)) {
                    return CheckRecipeResultRegistry.insufficientPower(costingWirelessEUTemp);
                }
            } else {
                // overflow because multiply extraCost
                costingWirelessEUTemp = 1145141919810L;
                BigInteger finalCostEU = BigInteger.valueOf(-1)
                    .multiply(BigInteger.valueOf(originEUCost))
                    .multiply(BigInteger.valueOf(extraEuCostMultiplier));
                if (!addEUToGlobalEnergyMap(ownerUUID, finalCostEU)) {
                    return CheckRecipeResultRegistry.insufficientPower(1145141919810L);
                }
            }
        } else {
            mMaxProgresstime = processingLogic.getDuration();
            setEnergyUsage(processingLogic);
        }

        mOutputItems = processingLogic.getOutputItems();
        mOutputFluids = processingLogic.getOutputFluids();

        return result;
    }

    @Override
    protected boolean isEnablePerfectOverclock() {
        return false;
    }

    @Override
    protected float getSpeedBonus() {
        return switch (mode) {
            case 1 -> 1F / ValueEnum.SpeedMultiplier_ComponentAssemblyLine_IndistinctTentacle;
            case 2 -> 1F / ValueEnum.SpeedMultiplier_Assembler_IndistinctTentacle;
            case 3 -> 1F / ValueEnum.SpeedMultiplier_PreciseAssembler_IndistinctTentacle;
            default -> 1F / ValueEnum.SpeedMultiplier_AssemblyLine_IndistinctTentacle;
        };
    }

    @Override
    protected int getMaxParallelRecipes() {
        return isWirelessMode ? Integer.MAX_VALUE : ValueEnum.Parallel_Default_IndistinctTentacle;
    }

    @Override
    public boolean checkMachine(IGregTechTileEntity aBaseMetaTileEntity, ItemStack aStack) {
        repairMachine();
        tierComponentCasing = -2;
        glassTier = 0;
        if (!checkPiece(STRUCTURE_PIECE_MAIN, horizontalOffSet, verticalOffSet, depthOffSet)) return false;

        // trans metal allow use wireless mode
        if (glassTier < GlassTierLimit_WirelessMode_IndistinctTentacle
            || tierComponentCasing + 1 < ComponentCasingTierLimit_WirelessMode_IndistinctTentacle) {
            // normal mode
            // glass tier limit hatch tier
            isWirelessMode = false;
            for (GT_MetaTileEntity_Hatch hatch : this.mExoticEnergyHatches) {
                // osmium glass allow use laser hatch
                if (this.glassTier < GlassTierLimit_LaserHatch_IndistinctTentacle
                    && hatch.getConnectionType() == GT_MetaTileEntity_Hatch.ConnectionType.LASER) {
                    return false;
                }
                if (this.glassTier < hatch.mTier) {
                    return false;
                }
            }
            for (GT_MetaTileEntity_Hatch hatch : this.mEnergyHatches) {
                if (this.glassTier < hatch.mTier) {
                    return false;
                }
            }
        } else {
            isWirelessMode = mEnergyHatches.isEmpty() && mExoticEnergyHatches.isEmpty();
        }
        return true;
    }

    @Override
    public void onFirstTick(IGregTechTileEntity aBaseMetaTileEntity) {
        super.onFirstTick(aBaseMetaTileEntity);
        this.ownerUUID = aBaseMetaTileEntity.getOwnerUuid();
    }
